/**
 * 
 * @param {*} idRestriccion 
 * este hook simplemente elimina la restriccion que le pases por parámetro
 */

const useEliminarRestriccion = async (idRestriccion) => {
    url = `https://localhost:5001/deleteRestriccion/${idRestriccion}`;
    await fetch(url).then(response => response.json()).then(data => console.log(data)); 
}

export default useEliminarRestriccion;
